import macCrest from './images/mcmaster/macCrest.png';
import './App.css';

function App() {

  const Navbar = () => {
    return (
        <div className="w-full bg-white">
            <div className="w-6/12 pl-6 flex py-3">
                <img src={macCrest} className="w-8" />
                <div className="flex">

                </div>
            </div>
        </div>
    );
  }

  return (
    <Navbar />
  );
}

export default App;
